import React from 'react';

const colaboradores = [
  {
    nombre: 'Dave Silva Alva',
    rol: 'Colaborador',
    imagen: 'https://randomuser.me/api/portraits/men/32.jpg',
  },
  {
    nombre: 'Cristian Enrique',
    rol: 'Colaborador',
    imagen: 'https://randomuser.me/api/portraits/men/45.jpg',
  },
  {
    nombre: 'Luis Flores',
    rol: 'Colaborador',
    imagen: 'https://randomuser.me/api/portraits/men/53.jpg',
  },
  {
    nombre: 'Naomi Gonzales',
    rol: 'Colaboradora',
    imagen: 'https://randomuser.me/api/portraits/women/60.jpg',
  },
  {
    nombre: 'Franco Mata',
    rol: 'Colaborador',
    imagen: 'https://randomuser.me/api/portraits/men/68.jpg',
  },
  {
    nombre: 'Martin Cuadros',
    rol: 'Colaborador',
    imagen: 'https://randomuser.me/api/portraits/men/72.jpg',
  },
];

function Colaboradores() {
  return (
    <div className="container mt-5 pt-5 pb-5">
      <div className="text-center mb-5">
        <h4 className="text-secondary mb-3">Miembros del equipo</h4>
        <h1 className="display-4">
          Conoce a nuestro <span className="text-primary">Equipo</span>
        </h1>
      </div>

      <div id="equipoCarousel" className="carousel slide" data-bs-ride="carousel">
        <div className="carousel-inner">
          {colaboradores.map((colaborador, index) => (
            <div
              className={`carousel-item ${index === 0 ? 'active' : ''}`}
              key={index}
            >
              <div className="d-flex justify-content-center">
                <div className="card text-center border-0 shadow" style={{ width: '18rem' }}>
                  <img
                    src={colaborador.imagen}
                    className="card-img-top rounded-circle mx-auto mt-4"
                    alt={colaborador.nombre}
                    style={{ width: '150px', height: '150px', objectFit: 'cover' }}
                  />
                  <div className="card-body">
                    <h5 className="card-title">{colaborador.nombre}</h5>
                    <p className="card-text text-muted">{colaborador.rol}</p>
                    <div className="d-flex justify-content-center gap-2">
                      <a href="#" className="text-primary"><i className="fab fa-facebook-f"></i></a>
                      <a href="#" className="text-primary"><i className="fab fa-twitter"></i></a>
                      <a href="#" className="text-primary"><i className="fab fa-linkedin-in"></i></a>
                      <a href="#" className="text-primary"><i className="fab fa-instagram"></i></a>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>

        <button
          className="carousel-control-prev"
          type="button"
          data-bs-target="#equipoCarousel"
          data-bs-slide="prev"
        >
          <span className="carousel-control-prev-icon"></span>
        </button>
        <button
          className="carousel-control-next"
          type="button"
          data-bs-target="#equipoCarousel"
          data-bs-slide="next"
        >
          <span className="carousel-control-next-icon"></span>
        </button>
      </div>
    </div>
  );
}

export default Colaboradores;
